title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o20236.m7 -> o20203.m10 -> o20236.m7
  o20203.m10 -> o20236.m7 -> o20203.m10
  o20236.m2 -> o20203.m10 -> o20236.m7 -> o20203.m10
  o20166.m18 -> o20192.m23 -> o20166.m18
  o20192.m23 -> o20166.m18 -> o20192.m23

features:
  - inheritance
  - overriding
  - method
  - polymorphism

